import "./App.css";
import { useState } from "react";
import Home from "./components/Home";
import Search from "./components/Search";
import { Route, Routes } from "react-router-dom";
import { update } from "./BooksAPI";

function App() {
  const handleUpdateBook = async (book, self) => {
    try {
      await update(book, self);
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="app">
      <Routes>
        <Route
          path="/"
          element={<Home handleUpdateBook={handleUpdateBook} />}
        />
        <Route
          path="/search"
          element={<Search handleUpdateBook={handleUpdateBook} />}
        />
      </Routes>
    </div>
  );
}

export default App;
